import React, { Component } from 'react';

function CreateRawCardDataList() {
  const cardList = _createCardList()
  console.log(cardList)  
  return cardList
}

const _createCardList = () => {
  let cardList = []
  cardList.push({ACardAttr:{style:{height:'300px',width}},ACardChild:_putBCardInACard()})
  return cardList
}

const _putBCardInACard = () => {
  let bCard1 = {}
  let bCard2 = {}
  let bCard3 = {}
  bCard1 = {BCardAttr:{style:{backgroundColor:'#dd9999'}},BCardChild:_putCCard1InBCard()}
  bCard2 = {BCardAttr:{style:{backgroundColor:'#dd99dd'}},BCardChild:_putCCar2InBCard()}
  bCard3 = {BCardAttr:{style:{backgroundColor:'#dd99dd'}},BCardChild:_putCCar2InBCard()}
  return [bCard1,bCard2,bCard3]
}

const _putCCard1InBCard = () => {
  let cCard1 = {value:'cCard1'}
  let cCard2 = {value:'cCard2'} 
  return [cCard1,cCard2]
}

const _putCCar2InBCard = () => {
  let cCard1 = {value:'cCard1'}
  let cCard2 = {value:'cCard2'} 
  return [cCard1,cCard2]
}

export default CreateRawCardDataList;
